import React, { useState, useEffect } from 'react';
import Login from './Login';
import Register from './Register';
import '../style/style.css';

const LandingPage = ({ setLoggedIn }) => {
  const [isLogin, setIsLogin] = useState(true);

  useEffect(() => {}, [isLogin]);

  const logOrRegister = (bool) => {
    setIsLogin(bool);
  };

  return (
    <>
      <img
        draggable='false'
        className='landingPageImg
        noselect'
        src='data:image/png;base64,'
      />
      <div className='parent'>
        <div className='body'>
          <div className='logo noselect'>
            <h1 className='logo0 noselect'>Post</h1>
            <h1 className='logo1 noselect'>Ur</h1>
            <h3 className='text noselect'>
              PostUr Opinions <br />
              in an anonymous way
            </h3>
          </div>
          <div className='logOrReg noselect'>
            <div className='tabs noselect'>
              <div
                className='logTab noselect'
                onClick={() => logOrRegister(true)}
              >
                <h3 id='log noselect'>Login</h3>
              </div>
              <div
                className='regTab noselect'
                onClick={() => logOrRegister(false)}
              >
                <h3 id='reg noselect'>Register</h3>
              </div>
            </div>
            {isLogin ? (
              <Login setLoggedIn={setLoggedIn} />
            ) : (
              <Register setLoggedIn={setLoggedIn} />
            )}
          </div>
        </div>
      </div>
    </>
  );
};

export default LandingPage;
